@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_central_nervous_system_mature_teratoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :adult_central_nervous_system_teratoma,
        :central_nervous_system_mature_teratoma .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_mature_teratoma rdfs:subClassOf :central_nervous_system_teratoma ;
    :has_definition "A mature teratoma that is located_in the central nervous system." ;
    :has_exact_synonym "Mature teratoma of the CNS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_central_nervous_system_immature_teratoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :adult_central_nervous_system_teratoma,
        :central_nervous_system_immature_teratoma .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_immature_teratoma rdfs:subClassOf :central_nervous_system_teratoma ;
    :has_definition "A malignant teratoma that is located_in the central nervous system." ;
    :has_exact_synonym "Immature teratoma of the CNS"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cancerophobia rdfs:subClassOf :nosophobia ;
    :has_exact_synonym "Fear of getting cancer"@en,
        "cancer phobia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:selective_ige_deficiency_disease rdfs:subClassOf :dysgammaglobulinemia ;
    :has_definition "A dysgammaglobulinemia that is characterized by isolated deficiency of IgE and subsequent mildly increased susceptibility to parasitic infections and allergic or autoimmune-related diseases." ;
    :has_exact_synonym "Selective IgE Immunodeficiency"@en,
        "Selective immunoglobulin E deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:selective_immunoglobulin_deficiency_disease rdfs:subClassOf :b_cell_deficiency ;
    :has_definition "A B cell deficiency that is characterized by deficiency of an immunoglobulin subtype. The clinical course and prognosis is dependent upon the severity of the selective deficiency and associated morbidity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_type_testicular_granulosa_cell_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        :testicular_granulosa_cell_tumor ;
    :has_exact_synonym "Juvenile granulosa cell tumor"@en,
        "Juvenile granulosa cell tumour"@en,
        "Juvenile type Granulosa cell tumor"@en,
        "Juvenile type Granulosa cell tumour"@en,
        "juvenile type granulosa cell neoplasm"@en,
        "juvenile type testicular granulosa cell tumour"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_fibrosarcoma rdfs:subClassOf :heart_sarcoma ;
    :has_exact_synonym "Fibrosarcoma of the Heart"@en,
        "cardiac fibrosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_malignant_hemangiopericytoma rdfs:subClassOf :heart_sarcoma ;
    :has_definition "A heart sarcoma that is a soft tissue sarcoma located in the heart." ;
    :has_exact_synonym "malignant hemangiopericytoma of Heart"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spindle_cell_intraocular_melanoma rdfs:subClassOf :ocular_melanoma ;
    :has_definition "An ocular malanoma that derives_from melanocytes in the uveal tract that results_in_formation_of spindle-shaped cells." ;
    :has_exact_synonym "Uveal spindle cell melanoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uveal_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :uvea ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        :melanoma,
        :uveal_cancer ;
    :has_definition "A uveal cancer that has_material_basis_in uvea pigment cells." ;
    :has_exact_synonym "melanoma of Uvea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choroid_spindle_cell_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :optic_choroid ],
        :malignant_choroid_melanoma,
        :melanoma ;
    :has_definition "A malignant choroid melanoma that is located_in the choroid." ;
    :has_exact_synonym "spindle cell melanoma of the Choroid"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ciliary_body_spindle_cell_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ciliary_body ],
        :ciliary_body_cancer,
        :melanoma ;
    :has_definition "A ciliary body cancer that is located_in the ciliary body and composed of spindled neoplastic cells arranged in sheets and fascicles." ;
    :has_exact_synonym "spindle cell melanoma of the Ciliary body"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flying_phobia rdfs:subClassOf :specific_phobia ;
    :has_definition "A specific phobia that is characterized by a fear of flying." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_disease rdfs:subClassOf :gastrointestinal_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :esophagus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A gastrointestinal system disease that is located_in the esophagus." ;
    :has_exact_synonym "esophageal Ulcer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_childhood_germ_cell_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :central_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :germ_cell ],
        :central_nervous_system_germ_cell_tumor ;
    :has_exact_synonym "central nervous system childhood germ cell tumour"@en,
        "paediatric germ cell neoplasm of CNS"@en,
        "pediatric germ cell neoplasm of CNS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_germ_cell_cancer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :germ_cell_cancer ;
    :has_definition "A germ cell cancer that presents in childhood." ;
    :has_exact_synonym "pediatric germ cell cancer",
        "paediatric germ cell cancer"@en,
        "paediatric germ cell neoplasm"@en,
        "pediatric germ cell neoplasm"@en ;
    :has_related_synonym "pediatric germ cell tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frontal_sinus_schneiderian_papilloma rdfs:subClassOf :frontal_sinus_benign_neoplasm ;
    :has_exact_synonym "Schneiderian papilloma of the Frontal sinus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasal_vestibule_papilloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mucosa ],
        :papilloma,
        :respiratory_system_benign_neoplasm ;
    :has_exact_synonym "papilloma of nasal vestibule"@en,
        "squamous papilloma of the nasal Vestibule"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_sequard_syndrome rdfs:subClassOf :paraplegia ;
    :has_exact_synonym "Brown-Squard syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_mucinous_neoplasm rdfs:subClassOf :ovary_epithelial_cancer ;
    :has_definition "An ovary epithelial cancer that is characterized by the presence of mucin." ;
    :has_exact_synonym "Ovarian mucinous tumor"@en,
        "malignant ovarian mucinous neoplasm"@en,
        "mucinous tumor of Ovary"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraplegia rdfs:subClassOf :central_nervous_system_disease ;
    :has_exact_synonym "Paraplegia, lower"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_testicular_germ_cell_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :testicular_germ_cell_cancer ;
    :has_exact_synonym "pediatric testicular germ cell tumor",
        "paediatric testicular germ cell neoplasm"@en,
        "paediatric testicular germ cell tumour"@en,
        "pediatric testicular germ cell neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_ovarian_endodermal_sinus_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :ovarian_endodermal_sinus_tumor ;
    :has_definition "An ovarian endodermal sinus tumor that presents in childhood." ;
    :has_exact_synonym "childhood ovarian endodermal sinus neoplasm"@en,
        "childhood ovarian endodermal sinus tumour"@en,
        "childhood ovarian yolk sac tumor"@en,
        "childhood ovarian yolk sac tumour"@en,
        "paediatric Ovarian Yolk Sac tumour"@en,
        "pediatric Ovarian Yolk Sac tumor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_ovarian_germ_cell_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :ovarian_germ_cell_cancer ;
    :has_definition "An ovarian germ cell cancer that presents in childhood." ;
    :has_exact_synonym "pediatric ovarian germ cell tumor",
        "paediatric Ovarian germ cell neoplasm"@en,
        "paediatric ovarian germ cell tumour"@en,
        "pediatric Ovarian germ cell neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meningeal_melanoma rdfs:subClassOf :malignant_leptomeningeal_neoplasm ;
    :has_exact_synonym "melanoma of the leptomeninges"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_stress_disorder rdfs:subClassOf :anxiety_disorder ;
    :has_definition "An anxiety disorder that has_symptom flashbacks, has_symptom bad dreams, has_symptom frightening thoughts, has_symptom avoidance or has_symptom hyperarousal of PTSD occurring within one month of a traumatic experience as Acute Stress Disorder or ASD." ;
    :has_exact_synonym "traumatic stress disorder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_leptomeningeal_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :meningeal_melanoma ;
    :has_exact_synonym "pediatric leptomeningeal melanoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_leptomeningeal_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :meningeal_melanoma ;
    :has_exact_synonym "melanoma of adult Leptomeninges"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thalamic_neoplasm rdfs:subClassOf :diencephalic_neoplasm ;
    :has_exact_synonym "malignant neoplasm of thalamus"@en,
        "malignant tumor of Thalamus"@en,
        "tumor of Thalamus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitral_valve_disease rdfs:subClassOf :heart_valve_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :mitral_valve ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Mitral RH valve dis."@en,
        "Rheumatic mitral insufficiency"@en,
        "Rheumatic mitral valve changes"@en,
        "Rheumatic mitral valve regurgitation"@en,
        "chronic rheumatic mitral valve"@en,
        "disease of mitral valve"@en,
        "rheumatic disease of mitral valve"@en,
        "rheumatic mitral valve incompetence"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:signet_ring_cell_variant_cervical_mucinous_adenocarcinoma rdfs:subClassOf :cervical_mucinous_adenocarcinoma ;
    :has_definition "A cervical mucinous adenocarcinoma that is characterized by the presence of signet ring cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:herpetic_gastritis rdfs:subClassOf :viral_gastritis ;
    :has_definition "A viral gastritis that involves inflammation of the stomach lining caused by herpes simplex virus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thoracic_spinal_canal_and_spinal_cord_meningioma rdfs:subClassOf :spinal_canal_and_spinal_cord_meningioma ;
    :has_exact_synonym "meningioma of the Thoracic Spinal canal and Spinal Cord"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jugular_foramen_meningioma rdfs:subClassOf :meningioma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meningioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :jugular_foramen ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "meningioma of the Jugular Foramen"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_meningioma rdfs:subClassOf :brain_meningioma,
        :cerebrum_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meningioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cerebrum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "meningioma of Cerebrum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_convexity_meningioma rdfs:subClassOf :cerebral_meningioma ;
    :has_exact_synonym "Cerebral Hemispheric Convexity meningioma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lateral_ventricle_meningioma rdfs:subClassOf :cerebral_meningioma,
        :cerebral_ventricle_cancer,
        :intraventricular_meningioma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meningioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :telencephalic_ventricle ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "meningioma of the Lateral Ventricle"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_pelvis_inverted_papilloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mucosa ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :papilloma,
        :renal_pelvis_urothelial_papilloma ;
    :has_exact_synonym "Inverted papilloma of the kidney Pelvis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_immunodeficiency_disease rdfs:subClassOf :immune_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_phenotype ;
                                    owl:someValuesFrom :abnormality_of_immune_system_physiology ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An immune system disease that results when one or more essential parts of the immune system is missing or not working properly at birth due to a genetic mutation." ;
    :has_exact_synonym "hypoimmunity"@en,
        "immune deficiency disorder"@en,
        "immunodeficiency syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anal_canal_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :anal_canal ],
        :anal_canal_cancer,
        :carcinoma ;
    :has_definition "An anal canal cancer that derives_from epithelial cells." ;
    :has_exact_synonym "anal canal and Perianal gland carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gliomatosis_cerebri rdfs:subClassOf :brain_cancer ;
    :has_definition "A brain cancer that is characterized by a pattern of diffuse infiltration of the brain that affect various areas of the cerebral lobes and has_material_basis_in abnormally proliferating cells, derives_from glial cells." ;
    :has_exact_synonym "Astrocytosis cerebri"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :low_grade_fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_tightness ],
        :bronchial_disease ;
    :has_definition "A bronchial disease that is an inflammation of the bronchial tubes. It is caused by bacteria and viruses. The disease has_symptom cough with mucus, has_symptom shortness of breath, has_symptom low fever and has_symptom chest tightness." ;
    :has_exact_synonym "CI - Chest infection"@en,
        "Chest infection"@en,
        "acute Bronchitis"@en,
        "chest cold"@en,
        "chronic bronchitis"@en,
        "recurrent wheezy bronchitis"@en ;
    :has_related_synonym "acute bronchitis and bronchiolitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

