    :has_definition "A uterus leiomyosarcoma characterized by the presence of round epithelioid, rhabdoid and large vacuolated cells intermingled with spindled cells and clear or eosinophilic cytoplasm." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphopenia rdfs:subClassOf :leukopenia ;
    :has_definition "A leukopenia that is the condition of having an abnormally low level of lymphocytes in the blood." ;
    :has_exact_synonym "Lymphocytopenia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasal_cavity_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :nasal_cavity_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nasal_cavity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma that is located_in the nasal cavity." ;
    :has_exact_synonym "carcinoma in situ of nasal cavities"@en,
        "carcinoma in situ of nasal cavity"@en,
        "stage 0 carcinoma of the nasal cavity"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukopenia rdfs:subClassOf :leukocyte_disease ;
    :has_definition "A leukocyte disorder that is characterized by a decrease in the number of white blood cells (leukocytes) found in the blood, which places individuals at increased risk of infection." ;
    :has_exact_match "MESH:D007970" ;
    :has_exact_synonym "Leucopenia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_choriocarcinoma_of_the_testis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :choriocarcinoma_of_the_testis ;
    :has_definition "A choriocarcinoma of the testis that is present during childhood." ;
    :has_exact_synonym "pediatric testicular Choriocarcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_testicular_mixed_germ_cell_tumor rdfs:subClassOf [ a owl:Restriction ;
