:cerebral_hemisphere_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebral_hemisphere ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :central_nervous_system_lipoma ;
    :has_exact_synonym "Lipoma of the Cerebral Hemisphere"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :central_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :central_nervous_system_benign_neoplasm,
        :lipoma ;
    :has_definition "A central nervous system benign neoplasm that derives_from fat cells." ;
    :has_exact_synonym "Lipoma of the CNS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corpus_callosum_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :corpus_callosum ],
        :cerebral_hemisphere_lipoma ;
    :has_exact_synonym "Lipoma of the Corpus Callosum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_esophagitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        :esophagitis,
        :viral_infectious_disease .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:genetic_disease rdfs:subClassOf :disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_basis_in ;
                                    owl:someValuesFrom :structural_variant ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease that has_material_basis_in genetic variations in the human genome." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fibromyalgia rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is is characterized by chronic widespread musculoskeletal pain, fatigue, sleep disturbances, cognitive dysfunction and depression." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clivus_chordoma rdfs:subClassOf :skull_base_chordoma ;
    :has_definition "A chordoma of skull base that is located in the clivus." ;
    :has_exact_synonym "Chordoma of Clivus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clivus_chondroid_chordoma rdfs:subClassOf :clivus_chordoma ;
    :has_definition "A chondroid chordoma and chordoma of the clivus that is located_in the clivus." ;
    :has_exact_synonym "Chondroid Chordoma of the Clivus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_fetiform_teratoma rdfs:subClassOf :mature_teratoma_of_the_ovary ;
    :has_definition "A mature teratoma of the ovary that resembles a malformed human fetus with the caudal portion being more developed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_solid_teratoma rdfs:subClassOf :mature_teratoma_of_the_ovary ;
    :has_definition "A mature teratoma of the ovary that is predominantly solid with interspersed cysts." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bartholin_s_gland_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :bartholin_s_gland_carcinoma ;
    :has_definition "A Bartholin's gland carcinoma that derives_from epithelial cells originating in glandular tissue." ;
    :has_exact_synonym "Bartholin gland adenocarcinoma"@en,
        "adenocarcinoma of the Bartholin's gland"@en ;
    :has_related_synonym "adenocarcinoma of bartholin's gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tibial_adamantinoma rdfs:subClassOf :long_bone_adamantinoma ;
    :has_definition "An adamantinoma of long bone that is located_in the tibia." ;
    :has_exact_synonym "Tibial adamantinoma morphology"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :myopathy ;
    :has_definition "A myopathy characterized by muscle inflammation." ;
    :has_exact_synonym "Inflammatory disorder of muscle"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immature_teratoma_of_ovary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ovary ],
        :malignant_ovarian_germ_cell_neoplasm ;
    :has_definition "A malignant ovarian germ cell neoplasm that is a teratoma containing variable amounts of immature (typically primitive/embryonal neuroectodermal) tissues, including, in its most primitive forms, embryoid bodies." ;
    :has_exact_synonym "malignant teratoma of Ovary"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_malignant_hemangiopericytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :hemangiopericytoma .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_intracranial_malignant_hemangiopericytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :connective_tissue_cancer ;
    :has_exact_synonym "adult malignant intracranial hemangiopericytoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anterior_optic_tract_meningioma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cranial_nerve_ii ] ;
                            rdf:rest :nil ] ] ],
        :meningioma,
        :optic_nerve_neoplasm .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_meningioma_of_optic_nerve rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cranial_nerve_ii ] ;
                            rdf:rest :nil ] ] ],
        :meningioma,
        :optic_nerve_neoplasm ;
    :has_exact_synonym "Bilateral meningioma of the optic nerve"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellopontine_angle_meningioma rdfs:subClassOf :brain_meningioma,
        :cerebellopontine_angle_tumor ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meningioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cerebellopontine_angle ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "meningioma of the Cerebellar Pontine Angle"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_eccrine_adenocarcinoma rdfs:subClassOf :vulva_adenocarcinoma ;
    :has_definition "A vulva adenocarcinoma that has_material_basis_in eccrine glands." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:melanotic_psammomatous_malignant_peripheral_nerve_sheath_tumor rdfs:subClassOf :malignant_melanocytic_neoplasm_of_the_peripheral_nerve_sheath ;
    :has_exact_synonym "melanocytic psammomatous MPNST" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_melanocytic_neoplasm_of_the_peripheral_nerve_sheath rdfs:subClassOf :malignant_peripheral_nerve_sheath_tumor ;
    :has_exact_synonym "Melanotic malignant nerve sheath tumor"@en,
        "Melanotic malignant peripheral nerve sheath tumor"@en,
        "Melanotic malignant peripheral nerve sheath tumour"@en,
        "melanocytic MPNST"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_immunodeficiency_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :congenital_transmission ;
                            rdf:rest [ rdf:first :contact_transmission ;
                                    rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                            rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :human_immunodeficiency_virus_infectious_disease ;
    :has_definition "A Human immunodeficiency virus infectious disease that results_in reduction in the numbers of CD4-bearing helper T cells below 200 per microliter of blood or 14% of all lymphocytes thereby rendering the subject highly vulnerable to life-threatening infections and cancers, has_material_basis_in Human immunodeficiency virus 1 or has_material_basis_in Human immunodeficiency virus 2, which are transmitted_by sexual contact, transmitted_by transfer of blood, semen, vaginal fluid, pre-ejaculate, or breast milk, transmitted_by congenital method, and transmitted_by contaminated needles. Opportunistic infections are common in people with AIDS." ;
    :has_exact_match "MESH:D000163" ;
    :has_exact_synonym "AIDS"@en,
        "acquired Immune deficiency"@en ;
    :has_related_synonym "acquired immune deficiency syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_lymphocytic_leukemia_small_lymphocytic_lymphoma rdfs:subClassOf :chronic_lymphocytic_leukemia ;
    :has_definition "A chronic lymphocytic leukemia that is characterized by the presence of immature lymphocytes in the blood and bone marrow and/or in the lymph nodes." ;
    :has_exact_synonym "B-cell lymphocytic leukemia/small lymphocytic lymphoma",
        "CLL/SLL"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_pontine_myelinolysis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paralysis ],
        :demyelinating_disease ;
    :has_definition "A demyelination disease that is characterized by severe damage to the myelin sheath of the pons' nerve cells and has_symptom acute paralysis, has_symptom dysphagia, and has_symptom dysarthria." ;
    :has_exact_synonym "osmotic demyelination syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:migraine rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        :brain_disease ;
    :has_definition "A brain disease that is characterized by moderate to severe headaches, nausea, extreme sensitivity to light and sound and intense unilaterial throbbing or pulsing." ;
    :has_exact_synonym "migraine disorder"@en,
        "migraine variant"@en,
        "migraine with or without aura"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acral_lentiginous_melanoma rdfs:subClassOf :skin_melanoma ;
    :has_definition "A skin melanoma that is characterized by slow growth of a small pigmented spot on the skin with a clearly defined edge, surrounded by normal-appearing skin and occurs on occurs on non hair-bairing surfaces including hands and feet, subungual sites, and fingers or toes." ;
    :has_exact_synonym "acral lentiginous melanoma, malignant"@en,
        "malignant acral lentiginous melanoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hepatic_osteogenic_sarcoma rdfs:subClassOf [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :fibroblast ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :chondroblast ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :derives_from ;
                                            owl:someValuesFrom :osteoblast ] ;
                                    rdf:rest :nil ] ] ] ],
        :liver_cancer ;
    :has_exact_synonym "Osteosarcoma of Liver"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersplenism rdfs:subClassOf :splenic_disease ;
    :has_exact_synonym "hypersplenia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_meningeal_melanocytosis rdfs:subClassOf :central_nervous_system_melanocytic_neoplasm ;
    :has_definition "A central nervous system melanocytic neoplasm that is characterized as diffuse or multifocal proliferation of uniform nevoid polygonal cells in the leptomeninges." ;
    :has_exact_synonym "Meningeal melanocytosis",
        "Diffuse Melanosis"@en,
        "Diffuse melanocytosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anterior_foramen_magnum_meningioma rdfs:subClassOf :foramen_magnum_meningioma ;
    :has_exact_synonym "meningioma of the Anterior Foramen Magnum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_brain_stem_glioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_brain_stem_neoplasm ;
    :has_exact_synonym "pediatric glioma of the Brainstem"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_brainstem_astrocytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_brain_stem_glioma .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_disseminated_encephalomyelitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :encephalomyelitis ;
    :has_definition "An encephalomyelitis characterized by inflammation located in brain and located in spinal cord that damages myelin. It usually occurs after viral infection, but also following vaccination, bacterial or parasitic infection." ;
    :has_exact_synonym "ADEM"@en,
        "acute disseminated encephalitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:encephalomyelitis rdfs:subClassOf :central_nervous_system_disease ;
    :has_exact_match "MESH:D004679" ;
    :has_exact_synonym "Encephalitis &/or myelitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_papillary_cystadenoma rdfs:subClassOf :ovarian_papillary_neoplasm ;
    :has_definition "An ovarian cystadenoma that is characterized by the presence of finger-like projections." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:double_outlet_right_ventricle rdfs:subClassOf :ventricular_septal_defect ;
    :has_exact_synonym "Dextrotransposition of aorta"@en,
        "Double outlet right ventricle with subpulmonary ventricular septal defect"@en,
        "Taussig-Bing syndrome or defect"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_surface_papilloma rdfs:subClassOf :ovarian_papillary_neoplasm ;
    :has_definition "An ovarian papillary neoplasm that is an exophytic growth with bland, serous-type epitheliumon the surface of the ovary." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovary_papillary_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ovary ],
        :ovarian_carcinoma ;
    :has_definition "An ovarian carcinoma that has_material_basis_in abnormally proliferating cells and derives_from epithelial cells." ;
    :has_exact_synonym "serous Surface Papillary carcinoma of Ovary"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tetralogy_of_fallot rdfs:subClassOf :congenital_heart_disease ;
    :has_exact_synonym "Ventricular septal defect with pulmonary stenosis or atresia, dextraposition of aorta, and hypertrophy of right ventricle"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_central_nervous_system_mature_teratoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :central_nervous_system_mature_teratoma .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eyelid_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :eyelid_disease,
        :skin_carcinoma ;
    :has_exact_synonym "carcinoma of the eyelid"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervical_adenoid_basal_carcinoma rdfs:subClassOf :cervix_carcinoma ;
    :has_definition """A cervix carcinoma that has_material_basis_in epithelium and is characterized by the presence of small,
well differentiated, rounded nests of basaloid cells.""" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:progressive_multifocal_leukoencephalopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :cognitive_impairment ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemiparesis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :aphasia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :coma ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :jc_polyomavirus ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that involves reactivation of JC polyomavirus in immune-compromised individuals which causes the loss of white matter (which is made up of myelin, a substance the surrounds and protects nerve fibers) in multiple areas of the brain. The symptoms include hemiparesis, aphasia, dysarthria, hemianopia, cognitive impairment and coma." ;
    :has_related_synonym "PML"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_hypertension rdfs:subClassOf :hypertension ;
    :has_definition "A hypertension characterized by an increase of blood pressure in the pulmonary artery, pulmonary vein or pulmonary capillaries." .

