            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :external_acoustic_meatus ],
        :apocrine_carcinoma .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_apocrine_adenocarcinoma rdfs:subClassOf :vulva_adenocarcinoma ;
    :has_definition "A vulva adenocarcinoma that has_material_basis_in apocrine glands." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_fibrosarcoma rdfs:subClassOf :central_nervous_system_sarcoma,
        :fibrosarcoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :fibrosarcoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Fibrosarcoma of the CNS"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cowden_syndrome rdfs:subClassOf :pten_hamartoma_tumor_syndrome ;
    :has_definition "A PTEN hamartoma tumor syndrome that is characterized by multiple noncancerous, tumor-like growths (hamartomas) and an increased risk of certain forms of cancer, especially breast, thyroid and endometrium." ;
    :has_exact_synonym "Cowden disease"@en,
        "Lhermitte-Duclos disease"@en,
        "dysplastic Gangliocytoma of Cerebellum"@en ;
    :has_related_synonym "multiple hamartoma syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

