    :has_definition "A cerebellum cancer that is characterized by consistent neuronal, variable astrocytic and focal lipomatous differentiation." ;
    :has_exact_synonym "Lipomatous Medulloblastoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
